def splitterFuncdef( columnName:String) = {
    jvm.select(columnName).filter(columnName +" != ''").flatMap(fun=>
    {
        fun.getString(0).split(",").map(_.trim)
    }).registerTempTable(columnName + "Table")

    spark.sql("select value as "+columnName+", count(0) as count from "+columnName+"Table group by "+columnName+" order by "+columnName)
}
